uint8_t oem_count = 0;

void Fake_ASIC_Read(uint16_t addr, uint16_t* data, uint8_t num)
{
    for (uint8_t i=0; i<=num; i++)
    {
        data[i] = i;
    }
}


void Fake_ASIC_Write(uint16_t addr, uint16_t* data, uint8_t num)
{
    for (uint8_t i=0; i<=num; i++)
    {
        data[i] = i;
    }
}

uint8_t Fake_ADC_Read(uint8_t ch, float *value)
{
    if (ch < 10)
    {
        *value = 2.35;
    } else
    {
        *value = 3.1;
    }
    return 1;
}

void Fake_ASIC_OemCapture(uint8_t word, uint8_t ch, uint8_t *data)
{
    uint16_t i;

    for (i=0; i<OEM_NUM_READS; i++)
    {
        data[(i*2)+0] = oem_data_array[oem_count][(i*2)+0];
        data[(i*2)+1] = oem_data_array[oem_count][(i*2)+1];
    }
    oem_count += 1;
    oem_count %= 4;
}
